\u590D\u5236\u4EE3\u7801
import React from 'react';
// \u6839\u636Efiber\u8282\u70B9\u521B\u5EFA\u771F\u5B9E\u7684dom\u8282\u70B9
function createDom(fiber) {
  const dom = fiber.type === 'TEXT_ELEMENT' ? document.createTextNode("") : document.createElement(fiber.type)

  const isProperty = key => key !== 'children'
  Object.keys(fiber.props)
    .filter(isProperty)
    .forEach(name => {
      dom[name] = fiber.props[name]
    })

  return dom
}

let nextUnitOfWork = null
// render\u51FD\u6570\u4E3B\u8981\u903B\u8F91\uFF1A
//   \u6839\u636Eroot container\u5BB9\u5668\u521B\u5EFAroot fiber
//   \u5C06nextUnitOfWork\u6307\u9488\u6307\u5411root fiber
//   element\u662Freact element tree
function render(element, container){
  nextUnitOfWork = {
    dom: container,
    props: {
      children: [element], // \u6B64\u65F6\u7684element\u8FD8\u53EA\u662FReact.createElement\u51FD\u6570\u521B\u5EFA\u7684virtual dom\u6811
    },
  }
}

function workLoop(deadline) {
  let shouldYield = false
  while (nextUnitOfWork && !shouldYield) {
    nextUnitOfWork = performUnitOfWork(nextUnitOfWork)
    shouldYield = deadline.timeRemaining() < 1
  }
  requestIdleCallback(workLoop)
}

requestIdleCallback(workLoop)

// performUnitOfWork\u51FD\u6570\u4E3B\u8981\u903B\u8F91\uFF1A
//   \u5C06element\u5143\u7D20\u6DFB\u52A0\u5230DOM
//   \u7ED9element\u7684\u5B50\u5143\u7D20\u521B\u5EFA\u5BF9\u5E94\u7684fiber\u8282\u70B9
//   \u8FD4\u56DE\u4E0B\u4E00\u4E2A\u5DE5\u4F5C\u5355\u5143\uFF0C\u5373\u4E0B\u4E00\u4E2Afiber\u8282\u70B9\uFF0C\u67E5\u627E\u8FC7\u7A0B\uFF1A
//      1.\u5982\u679C\u6709\u5B50\u5143\u7D20\uFF0C\u5219\u8FD4\u56DE\u5B50\u5143\u7D20\u7684fiber\u8282\u70B9
//      2.\u5982\u679C\u6CA1\u6709\u5B50\u5143\u7D20\uFF0C\u5219\u8FD4\u56DE\u5144\u5F1F\u5143\u7D20\u7684fiber\u8282\u70B9
//      3.\u5982\u679C\u65E2\u6CA1\u6709\u5B50\u5143\u7D20\u53C8\u6CA1\u6709\u5144\u5F1F\u5143\u7D20\uFF0C\u5219\u5F80\u4E0A\u67E5\u627E\u5176\u7236\u8282\u70B9\u7684\u5144\u5F1F\u5143\u7D20\u7684fiber\u8282\u70B9
//      4.\u5982\u679C\u5F80\u4E0A\u67E5\u627E\u5230root fiber\u8282\u70B9\uFF0C\u8BF4\u660Erender\u8FC7\u7A0B\u5DF2\u7ECF\u7ED3\u675F
function performUnitOfWork(fiber) {
  // \u7B2C\u4E00\u6B65 \u6839\u636Efiber\u8282\u70B9\u521B\u5EFA\u771F\u5B9E\u7684dom\u8282\u70B9\uFF0C\u5E76\u4FDD\u5B58\u5728fiber.dom\u5C5E\u6027\u4E2D
  if(!fiber.dom){
    fiber.dom = createDom(fiber)
  }

  // \u7B2C\u4E8C\u6B65 \u5C06\u5F53\u524Dfiber\u8282\u70B9\u7684\u771F\u5B9Edom\u6DFB\u52A0\u5230\u7236\u8282\u70B9\u4E2D\uFF0C\u6CE8\u610F\uFF0C\u8FD9\u4E00\u6B65\u662F\u4F1A\u89E6\u53D1\u6D4F\u89C8\u5668\u56DE\u6D41\u91CD\u7ED8\u7684\uFF01\uFF01\uFF01
  if(fiber.parent){
    fiber.parent.dom.appendChild(fiber.dom)
  }
  // \u7B2C\u4E09\u6B65 \u7ED9\u5B50\u5143\u7D20\u521B\u5EFA\u5BF9\u5E94\u7684fiber\u8282\u70B9
  const children = fiber.props.children
  let prevSibling
  children.forEach((child, index) => {
    const newFiber = {
      type: child.type,
      props: child.props,
      parent: fiber,
      dom: null
    }
    if(index === 0){
      fiber.child = newFiber
    } else {
      prevSibling.sibling = newFiber
    }
    prevSibling = newFiber
  })

  // \u7B2C\u56DB\u6B65\uFF0C\u67E5\u627E\u4E0B\u4E00\u4E2A\u5DE5\u4F5C\u5355\u5143
  if(fiber.child){
    return fiber.child
  }
  let nextFiber = fiber
  while(nextFiber){
    if(nextFiber.sibling){
      return nextFiber.sibling
    }
    nextFiber = nextFiber.parent
  }

}
const MiniReact = {
  createElement:  (type, props, ...children) => {
    return {
      type,
      props: {
        ...props,
        children: children.map(child => {
          if(typeof child === 'object'){
            return child
          }
          return {
            type: 'TEXT_ELEMENT',
            props: {
              nodeValue: child,
              children: [],
            }
          }
        })
      }
    }
  },
  render
}
/** @jsx MiniReact.createElement */
const element = (
  <div>
    <h1>
      <p />
      <a />
    </h1>
    <h2 />
  </div>
)
// const element = (
//   <div id="foo">
//     <a>bar</a>
//     <b />
//   </div>
// )

console.log('element======', element)
const container = document.getElementById("root")
